import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

function App2() {
	return (
		<>
			<div className="Prime_heading">
				<h1>List of Amazing Prime Series</h1>
			</div>
			<Card
				sname={Sdata[0].sname}
				imgsource={Sdata[0].imgsource}
				title={Sdata[0].title}
				links={Sdata[0].links}
			/>
			<Card
				sname={Sdata[1].sname}
				imgsource={Sdata[1].imgsource}
				title={Sdata[1].title}
				links={Sdata[1].links}
			/>
			<Card
				sname={Sdata[2].sname}
				imgsource={Sdata[2].imgsource}
				title={Sdata[2].title}
				links={Sdata[2].links}
			/>
		</>
	);
}
export default App2;
